import React from "react";
import "./style.css";
import Follow from "../Follow/Follow";

function Suggestions() {
  return (
    <div className="main-container">
      <div className="top-header">
        <div>
          <h2>Suggestions for you</h2>
        </div>
        <div>
          <button>see all</button>
        </div>
      </div>
      <div>
        <Follow />
        <Follow />
        <Follow />
        <Follow />
      </div>
    </div>
  );
}

export default Suggestions;
